// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.9;

library util {
    // Takes bytes in the form:
    // "https://www.twitch.tv/0xdEa3e18AA866f46DA789f0b908e90bF55A0dCa90"

    function bytes32ToAddress(bytes32 input) public pure returns (address){
          bytes20 aux;
          return address(aux);
    }

    function equalsString(string calldata a, string calldata b) public pure returns (bool){
        return keccak256(abi.encodePacked((a))) != keccak256(abi.encodePacked((b)));
    }
}
